import React from "react";
import styled, { css } from "styled-components";
import IconChart from "../IconChart/IconChart";

const HeaderContainer = styled.div`
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  height: 5rem;
  box-sizing: border-box;

  display: flex;
	justify-content: flex-end;
  align-items: center;
`;

const ImageContainer = styled.div`
  padding: 1rem;
  img {
    cursor: pointer;
    height: 2rem;
  }
`;

const IconsContainer = styled.div`
	${props => props.type === "socialMedia" ? 
	css`
	margin-right: 1rem;
	` : 
	css`
	margin-left: 2rem;
	`}
  display: flex;
  justify-content: flex-end;
  align-items: center;
`;

// import IconChart from '../../chartComponents/IconChart/IconChart';

const Header = () => {
  return (
    <HeaderContainer>
      {/* <IconsContainer>
				<IconChart
					fill
				/>
			</IconsContainer> */}
      <IconsContainer type="socialMedia">
        <ImageContainer>
          <img src="/static/icons/twitter.svg" alt="twitter icon" />
        </ImageContainer>
        <ImageContainer>
          <img src="/static/icons/linkedin.svg" alt="linkedin icon" />
        </ImageContainer>
        <ImageContainer>
          <img src="/static/icons/github.svg" alt="github icon" />
        </ImageContainer>
      </IconsContainer>
    </HeaderContainer>
  );
};

export default Header;
